import React from 'react';

class Search extends React.Component{
    constructor(){
        super();

        this.state = {
            searchText: ''
        }
    }

    setSearchText = (e) =>{
        this.setState({searchText: e.target.value});
    }

    render(){
        return(
            <div>
                <input type='text' onChange = {e => this.setSearchText(e)}/>
                {console.log(this.state.searchText)}
            </div>
        )
    }
}

export default Search;
